const isLogged = (state = false, action) => {
  switch (action.type) {
    case "USER_LOGIN":
      return action.data;

    case "USER_LOGOUT":
      return "";

    case "SET_NEW_USERNAME":
      return "";
    default:
      return state;
  }
};
export default isLogged;
